export const getSvg = (svgicon: string) => {
    switch (svgicon) {
        case "background":
            return backgroundSvg;
        case "About Your Relationship":
            return about_your_relationship;
        case "About Your Children":
            return about_your_children;
        case "Tax Year":
            return tax_year;
        case "Income":
            return Income;
        case "Adjustment to Total Income":
            return Adjustment_to_Total_Income;
        case "Special Expenses":
            return Special_expense;
        case "Undue Hardship":
            return undue_harship;
        case "Review":
            return review;
        case "HusbandImage":
            return husband_image;
        case "WifeImage" :
            return wife_image  ;  
        case "Support Quantum range" :
            return Support_Quantum_range  ;   
        case "Spousal Support Duration Range" :
            return Spousal_Support_Duration_Range  ;   
        case "Child Special Expense Support" :
                return Child_Special_Expense_Support  ;       
        case "Lump Sum Amount" :
            return lumpsumImage  ;   
        case "SpousalSupportArrow" :
            return spousalSupportArrow  ;   
        case "ChildSupportArrow" :
            return childSupportArrow  ;   
        case "Other household member" :
            return otherhouseholdmember  ; 
        case "The Calculation" :
            return the_calculation  ; 
        case "Client" :
            return client  ; 
        case "Opposing Party" :
           return opposing_party  ; 
        case "Child SupportCheckout" :
            return child_supportCheckout  ; 
        case "Spousal SupportCheckout" :
          return spousal_supportCheckout  ; 
        case "Indefinite_Checkout" :
            return Indefinite_Checkout  ; 
        case "dateDiffyrs" :
              return dateDiffyrs  ; 
        case "year relationship checkout" :
              return year_relationship_checkout  ; 
        case "yrs / lives with checkout" :
                return yrs_lives_with_checkout  ; 
        case "yrs_province" :
                return yrs_province  ; 

        default: return ""
    }
}

